function addLiquidGlassFilter(): void {
    try {
        const existingFilter = document.getElementById("asri-enhance-liquid-glass-filter");
        if (existingFilter) {
            return;
        }
        const head = document.head;
        if (head) {
            const tempDiv = document.createElement("div");
            tempDiv.innerHTML = LIQUID_GLASS_SVG;
            const svgElement = tempDiv.firstElementChild as SVGElement;
            if (svgElement) {
                head.appendChild(svgElement);
            }
        }
    } catch (e) {}
}
function removeLiquidGlassFilter(): void {
    try {
        const filterElement = document.getElementById("asri-enhance-liquid-glass-filter");
        if (filterElement) {
            filterElement.remove();
        }
    } catch (e) {}
}
export async function onLiquidGlassClick(plugin: Plugin, event?: MouseEvent): Promise<void> {
    if (event) {
        event.preventDefault();
        event.stopPropagation();
    }
    const htmlEl = document.documentElement;
    if (!htmlEl) {
        return;
    }
    const isActive = htmlEl.hasAttribute("data-asri-enhance-liquid-glass");
    const config = (await loadData(plugin, CONFIG_FILE)) || {};
    if (isActive) {
        htmlEl.removeAttribute("data-asri-enhance-liquid-glass");
        config[CONFIG_KEY] = false;
        removeLiquidGlassFilter();
    } else {
        htmlEl.setAttribute("data-asri-enhance-liquid-glass", "true");
        config[CONFIG_KEY] = true;
        addLiquidGlassFilter();
    }
    await saveData(plugin, CONFIG_FILE, config).catch(() => {});
}
export async function applyLiquidGlassConfig(plugin: Plugin, config?: Record<string, any> | null): Promise<void> {
    const htmlEl = document.documentElement;
    if (!htmlEl) {
        return;
    }
    const configData = config !== undefined ? config : await loadData(plugin, CONFIG_FILE);
    if (configData && configData[CONFIG_KEY] === true) {
        htmlEl.setAttribute("data-asri-enhance-liquid-glass", "true");
        addLiquidGlassFilter();
    } else {
        htmlEl.removeAttribute("data-asri-enhance-liquid-glass");
        removeLiquidGlassFilter();
    }
}
